// import { useEffect, useState } from "react";

// @mui material components
import Grid from "@mui/material/Grid";
// import Icon from "@mui/material/Icon";

// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
// import Footer from "examples/Footer";
// import MiniStatisticsCard from "examples/Cards/StatisticsCards/MiniStatisticsCard";
// import ProgressLineChart from "examples/Charts/LineCharts/ProgressLineChart";
// import DefaultInfoCard from "examples/Cards/InfoCards/DefaultInfoCard";
// import MasterCard from "examples/Cards/MasterCard";
// import MiniInfoCard from "examples/Cards/InfoCards/MiniInfoCard";
// import ControllerCard from "examples/Cards/ControllerCard";
// import Calendar from "examples/Calendar";
// import CategoriesList from "examples/Lists/CategoriesList";

// Widgets page components
// import Steps from "layouts/pages/rtl/components/Steps";
// import FullBody from "layouts/pages/rtl/components/FullBody";
// import MediaPlayer from "layouts/pages/rtl/components/MediaPlayer";
// import OrdersOverview from "layouts/pages/rtl/components/OrdersOverview";
// import UpcomingEvents from "layouts/pages/rtl/components/UpcomingEvents";
// import Chart from "layouts/pages/rtl/components/Chart";

// Data
// import progressLineChartData from "layouts/pages/rtl/data/progressLineChartData";
// import calendarEventsData from "layouts/pages/rtl/data/calendarEventsData";
// import categoriesListData from "layouts/pages/rtl/data/categoriesListData";
// import incomeChartData from "layouts/pages/rtl/data/incomeChartData";
// import caloriesChartData from "layouts/pages/rtl/data/caloriesChartData";

// Soft UI Dashboard PRO React contexts
// import { useSoftUIController } from "context";
import { Table } from 'react-bootstrap';

function RTL() {

  return (

    <DashboardLayout>
      <DashboardNavbar />
      <SuiBox py={1}>
        <Grid container>
          <Grid item xs={12} lg={12}>
            <SuiBox mb={3} p={1}>
              <SuiTypography variant="h4" fontWeight="large" fontSize="1.6rem">
               <br/>
                  Rejected Transactions Report - User wise

              </SuiTypography>
              <h4 style={{ textAlign: 'right' }}>
                <a href="/holding/ schemewise">  Rejected Transactions Report - Date wise </a>
                </h4>
            </SuiBox>
          </Grid>
          <Grid item xs={15} lg={12} py={.05}>
            <SuiBox mb={3}>
              <Table striped bordered hover size="sm" style={{ textAlign: "center", borderColor: 'black' }}>
                <thead>
                  <tr>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>Scheme</th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>Invested Amount</th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>AUM</th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>Details</th>
                  </tr>
                </thead>
                <tbody>
                  <tr>
                    <td style={{ Color: "#038d8a", padding: "10px" }}>ADITYA BIRLA SUN LIFE BALANCED FHND - GROWTH OPTION</td>
                    <td>10,74,000</td>
                    <td>7,50,000</td>
                    {/* <td>11,20,492</td> */}
                  </tr>
                  <tr>
                    <td style={{ Color: "#038d8a", padding: "10px" }}>ADITYA BIRLA SUN LIFE BALANCED FHND - GROWTH - REGULAR OPTION</td>
                    {/* <td>AGARWAL BUILDCON</td> */}
                    <td>2,00,000</td>
                    <td>3,02,603</td>
                  </tr>
                  <tr>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd", padding: '10px' }}> Total</td>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd" }}>12,87,62,505</td>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd" }}>15,33,16,151</td>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd" }}>---</td>
                  </tr>
                </tbody>
              </Table>
            </SuiBox>
          </Grid>
        </Grid>
      </SuiBox>
    </DashboardLayout>
  );
}

export default RTL;
